import { render } from "react-dom";

export class TrueSquare extends React.Component {
    render() {
        return (
            <button 
                className="true-square"
                value={this.props.value}
            ></button>
        );
    }   
}

export class FalseSquare extends React.Component {
    render() {
        return (
            <button 
                className="false-square"
                value={this.props.value}
            ></button>
        );
    }
}

